B.wr=A.a(s(["Tillman Hall is a historic building located on the campus of Clemson University. Constructed in the early 20th century, it stands as a symbol of the university's rich heritage and academic tradition. With its iconic clock tower and elegant architecture, Tillman Hall is a focal point of campus life, hosting administrative offices and serving as a gathering place for students and faculty alike.\n  \nStep into the heart of Clemson University's history and academia by visiting Tillman Hall. Explore its majestic architecture and learn about its significance to the university's past and present.","Known affectionately as 'Death Valley,' Clemson Memorial Stadium is the legendary home of the Clemson Tigers football team. With a seating capacity of over 80,000, it is one of the largest stadiums in the Atlantic Coast Conference. The stadium pulsates with energy on game days as fans come together to cheer on their team amidst a sea of orange and purple.\n  \nImmerse yourself in the electrifying atmosphere of college football by attending a game at Clemson Memorial Stadium. Join the roaring crowd and experience the passion and excitement of Tigers football firsthand.","McAdams Hall is a bustling hub of academic activity at Clemson University. McAdams Hall offers a supportive environment where Computer Science students can thrive both academically and socially.\n  \nExperience the vibrant community spirit of Clemson University by visiting McAdams Hall. Take a stroll through its halls, engage with students, and get a taste of campus life firsthand.","Strode Tower is a prominent academic building located on the campus of Clemson University. Housing classrooms, lecture halls, and academic offices for the Humanities department, it serves as a vital hub for learning and education. With its distinctive architecture and central location, Strode Tower stands as a beacon of academic excellence, providing students with the resources and facilities they need to succeed in their studies.\n  \nImmerse yourself in the academic environment of Clemson University by visiting Strode Tower. Attend a lecture, participate in a seminar, or simply explore its corridors to experience firsthand the energy and enthusiasm of learning on campus.","The Wilbur O and Ann Power College of Business is a prestigious academic institution dedicated to excellence in business education and research. Housed in modern facilities equipped with cutting-edge technology, it offers a comprehensive range of undergraduate and graduate programs designed to prepare students for success in the dynamic world of business. With world-class faculty, innovative curriculum, and extensive networking opportunities, the College of Business provides students with the knowledge, skills, and resources they need to thrive in today's global marketplace.\n  \nExplore the exciting world of business and entrepreneurship by visiting the Wilbur O and Ann Power College of Business. Attend a lecture, meet with faculty members, and learn about the diverse array of academic and professional opportunities available to students pursuing a career in business.","Cooper Library is the academic heart of Clemson University, providing students and faculty with access to a vast collection of resources, services, and study spaces. From books and journals to digital archives and research databases, the library offers comprehensive support for learning, research, and scholarship across a wide range of disciplines. With its welcoming atmosphere and knowledgeable staff, Cooper Library is a place where students can explore, discover, and excel.\n  \nEmbark on a journey of learning and discovery by visiting Cooper Library. Dive into its extensive collection of resources, find a quiet corner to study or collaborate with peers, and take advantage of the technical expertise offered by the CCIT support center. Whether you need help with software installation, troubleshooting connectivity, or accessing online resources, the knowledgeable staff at CCIT are available to assist you.","The Fluor Daniel Engineering Innovation Building is a state-of-the-art facility dedicated to advancing education and research in engineering and technology. With its cutting-edge laboratories, collaborative workspaces, and advanced equipment, it provides students and faculty with the tools and resources they need to tackle complex engineering challenges and drive innovation in their fields. From mechanical and electrical engineering to computer science and bioengineering, the building fosters interdisciplinary collaboration and hands-on learning experiences that prepare students for successful careers in engineering.\n  \nExplore the frontiers of engineering and technology by visiting the Fluor Daniel Engineering Innovation Building. Engage with faculty and students, tour the facilities, and discover the exciting research and innovation happening within its walls.","Freeman Hall is a dynamic center for education and research in the sciences at Clemson University. Home to multiple academic departments and research centers, it offers a wide range of programs and opportunities for students interested in exploring the natural and physical sciences. With its state-of-the-art laboratories, cutting-edge research facilities, and dedicated faculty, Freeman Hall provides students with hands-on learning experiences and prepares them for careers in fields such as chemistry, biology, physics, and environmental science.\n  \nDive into the world of science and discovery by visiting Freeman Hall. Explore its laboratories, attend a seminar or lecture, and learn about the groundbreaking research being conducted by faculty and students in fields ranging from chemistry and biology to physics and environmental science.","Brackett Hall at Clemson University is notably associated with the Department of Environmental Engineering and Earth Sciences. This facility plays a vital role in supporting the academic and research endeavors in geology, biosystems engineering, and environmental engineering. Students and faculty are engaged in a wide array of research activities, fostering a collaborative environment conducive to learning and discovery in these critical fields\u200b\u200b. \n  \nMoreover, Brackett Hall is home to the Department of Political Science, offering a comprehensive curriculum that spans American politics, comparative politics, international relations, political theory, public policy, and public administration. The department emphasizes small class sizes to promote student participation and close faculty-student interaction, aiming to enhance students' critical thinking and empirical skills. The department prides itself on teaching excellence and has a strong track record of its graduates pursuing successful careers in law, government, journalism, and academia, among other fields\u200b\u200b.","The Brooks Center for the Performing Arts at Clemson University, established in 1994, serves as a premier hub for the performing arts on campus. This 87,000-square-foot facility boasts a spacious yet intimate 979-seat proscenium auditorium, a 100-seat black box theatre for student theatre performances, and a small recital hall used for various purposes, including classes and performances. \n  \nThe Center's mission is multifaceted, aiming to present outstanding artists and attractions, encourage new and experimental works, develop diversified audiences for the performing arts, and support the educational mission of the Department of Performing Arts\u200b\u200b.\n    ","The Biosystems Research complex likely originated from Clemson University's strategic plan to advance research in biosystems engineering, agriculture, environmental science, and related fields. It serves as a hub for interdisciplinary research, aimed at solving complex global challenges related to food, water, and energy sustainability.\n  \nThe Biosystems Research Complex supports a wide range of research activities, from developing sustainable agricultural practices to creating new biotechnologies. The work conducted within its walls contributes to Clemson University's reputation as a leader in research and innovation, with potential impacts extending beyond academia into industry and policy. Such a complex would typically include state-of-the-art laboratories, controlled environment facilities, and collaborative spaces. These resources enable faculty, students, and researchers to conduct high-level research and provide students with hands-on learning opportunities.\n    ","Hardin Hall is the oldest academic building on campus. It was originally built as the Chemistry laboratory, it was expanded in 1900 and 1937, and has housed the Education department and administration offices. It currently houses the departments of History, Philosophy, and Religion. The building is a contributing property to the Clemson University Historic District II.\n    ","Riggs Hall was built to replace Mechanical Hall, which burned in 1926. It was designed by Architecture department chairman Rudolph E. Lee. The departments of Architecture, Civil Engineering, Electrical Engineering, and Mechanical Engineering were the first tenants. Architecture and Civil Engineering moved into the new Structural Science Building in 1958, but Electrical and Mechanical Engineering are still located in the building\n    ","Sirrine Hall was built to replace Godfrey Hall as the Textile building. It was one of 8 buildings built between 1936 and 1938, and designed by Rudolph E. Lee in an Italian Renaissance Revival style. The building housed the College of Business until the 2020\u20132021 school year.\n    ","The Outdoor Theater was built as a gift of the Class of 1915, and designed by one of its members and the university's first architecture graduate, Leon LeGrand. It was built in cooperation with the Work Projects Administration. The Art Deco stage was nearly demolished and replaced in 1977, but protests prompted its renovation and the addition of concrete terraced seating.\n    ","Bowman Field was originally used as drill, marching, and parade grounds, and the location for commencement and military commissions during the school's years as a military college. It was also the home of the football and baseball teams before the construction of Riggs Field in 1916.\n  \nIt has hosted numerous athletic events and is today a versatile space for student activities and events like Homecoming. Managed by Clemson Major Events, it's ideal for traditional Clemson gatherings, emphasizing its historical and cultural significance on campus.","Littlejohn Coliseum, named after James Corcoran Littlejohn from the class of 1908, is a key facility at Clemson University. It hosts the university's basketball teams, concerts, shows, and all graduation ceremonies. The coliseum, with a total seating capacity of 10,980, was first used for a basketball game in 1968 after being constructed to replace the Field House Big Gym\u200b\u200b.\n  \nCheer on the Tigers and experience the thrill of live sports and entertainment at Littlejohn Coliseum. Attend a basketball game, rock out to a concert, or participate in campus events hosted in this iconic venue that brings the Clemson community together.\n    ","Schilletter Dining Hall is a bustling culinary destination at Clemson University, offering a wide array of delicious and nutritious dining options for students, faculty, and staff. With its diverse selection of food stations, cozy seating areas, and vibrant ambiance, it provides a welcoming environment for dining, socializing, and enjoying delicious meals.\n  \nIndulge in a culinary adventure at Schilletter Dining Hall. Explore the variety of cuisines, savor freshly prepared dishes, and enjoy the lively atmosphere as you dine with friends, meet new people, and experience the vibrant dining culture of Clemson University.\n    ","Sikes Hall was built when the Agriculture department outgrew its space in Tillman Hall. Situated at the original entrance to John C. Calhoun's Fort Hill Plantation, the building was designed by Rudolph E. Lee, and modeled after the Library of Congress Building. After a fire in 1924, it was remodeled into a library. Today, Sikes is the main administration building. It is a contributing property to the Clemson University Historic District I.\n  \nOriginally built in 1904 as Agricultural Hall, it has transitioned through various roles, including a library until 1966, before becoming the administration building in 1972. This building, named after Clemson's sixth president, Enoch Walter Sikes, also interestingly hosted a museum and gymnasium in the past.\n  ","Long Hall was originally constructed for the Agriculture department. It was built on the former site of the university's cooperative extension service. It was designed in an Italianate style by Rudolph E. Lee. It is currently the home of the Biology department. The buildings is a contributing property to the Clemson University Historic District I\n  \nNamed after William Williams Long, it accommodates various majors within the College of Agriculture, Forestry, and Life Sciences, including entomology, biology, and plant pathology.\n    ","The Douthit Hills Community Hub is a modern gathering place situated within the vibrant Douthit Hills residential community at Clemson University. Designed to foster connections and enhance campus life, it offers a range of amenities and services for students, faculty, and staff. From dining options and study spaces to recreational facilities and the campus bookstore, the Douthit Hills Community Hub provides a welcoming environment where individuals can come together, collaborate, and thrive.\n  \nImmerse yourself in the dynamic community atmosphere of Douthit Hills by visiting the Douthit Hills Community Hub. Explore its diverse offerings, connect with fellow residents, and engage in the array of activities and programs designed to enrich your university experience. Whether you're grabbing a bite to eat, studying with friends, or attending a community event, the Douthit Hills Community Hub is the perfect place to call home away from home.\n    "]),t.s)
